import React from 'react';

export const About = () => {
    return (
        <div className="jumbotron">
            <div className="container">
                <h1 className="display-4">Note App - Лучшее приложение на React</h1>
                <p className="lead">Версия приложения <strong>1.0.17</strong></p>
                <p className="lead">Модули для разработки
                <strong><ul>
                        <li>SASS</li>
                        <li>React-Router-Dom</li>
                        <li>Bootstrap</li>
                        <li>Axios</li>
                    </ul>
                    </strong>
                </p>
            </div>
        </div>
    );
}
